import React from 'react';
import { BrowserRouter as Router, Route } from "react-router-dom";

import User from './pages/User';

const App = () => {
  return (
    <Router>
      <Route path="/user" exact component={User} />
      <Route path="/goal"  component={About} />
      <Route path="/habit"  component={Contact} />
    </Router>
  );
}

const About = () => (
  <h1>About</h1>
);

const Contact = () => (
  <h1>Contact</h1>
);

export default App;
